INSERT INTO producto
VALUES
   (10104581, 3, 1, '2023 1 Meal One Day Dining', 'Waiting on Translations', 241.38, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 1444, 1)
   , (10105271, 1, 1, '2023 Diamond Pass', '¡Obtén visitas ilimitadas a todos los parques de Six Flags, además de Hurricane Harbor Oaxtepec! También, recibirás beneficios exclusivos como estacionamiento sin costo, descuentos en souvenirs seleccionados, descuentos en Planes de Alimentos y más. Incluye acceso a Christmas in the Park 2022.El pase vence en el primer aniversario de la fecha de compra. No incluye el consumo de alimentos, bebidas, mercancía, juegos de destreza, atracciones con costo adicional, conciertos o eventos especiales.', 0.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 597, 1)
   , (10105273, 1, 1, '2023 Platinum Pass', '¡Obtén visitas ilimitadas a todos los parques de Six Flags, además de Hurricane Harbor Oaxtepec! También, recibirás beneficios exclusivos como estacionamiento sin costo, descuentos en comida y souvenirs seleccionados y más.El pase vence el 31 de diciembre de 2023.  No incluye el consumo de alimentos, bebidas, mercancía, juegos de destreza, atracciones con costo adicional, conciertos o eventos especiales. ', 0.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 970, 1)
   , (10105058, 3, 1, '2023 SFMX Mega Meal Deal Tax Exempt', 'Waiting on Translations', 241.38, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1248, 1)
   , (10081280, 2, 1, 'Boleto de un Día', 'Válido para una Admisión General a Six Flags México únicamente para el día seleccionado en la compra. Niñas y niños menores de 90 cm de estatura entran GRATIS. Este boleto no incluye acceso a las Atracciones de Terror de Festival del Terror.Boleto personal e intransferible. Alimentos, bebidas, mercancía, juegos de destreza y atracciones con costo adicional no están incluidas en el boleto. El acceso a los juegos mecánicos está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones de seguridad de cada juego. Este boleto será válido para usarse una sola vez el día de la visita. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. El acceso al parque se permite hasta una hora antes del cierre del mismo. Compra no reembolsable o modificable una vez confirmada. Si requieres acceso a las Atracciones de Terror de Festival del Terror, puedes adquirir el combo "Boleto de un día + Pase de Atracciones de Terror", o comprarlo por separado.', 629.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 1364, 1)
   , (10091425, 2, 1, 'Boleto de un dia', 'Válido para una admisión a Six Flags México en el día y horario de operación seleccionado. La compra de este boleto incluye una reservación al parque. No aplican reembolsos ni cancelaciones.Tu boleto es personal e intransferible. Niños menores de 90 cm entran gratis. Válido por un día de visita con acceso a todos los juegos mecánicos. No incluye juegos de destreza o ningún tipo de atracción con costo adicional. CUPO LIMITADO. EL TITULAR DEBERÁ PRESENTAR IDENTIFICACIÓN OFICIAL Y TARJETA CON LA QUE FUE REALIZADA LA COMPRA.', 0.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 222, 1)
   , (90001430, 10, 1, 'Boleto de un Día', 'Válido para una Admisión General a Six Flags México únicamente para el día seleccionado en la compra. Niñas y niños menores de 90 cm de estatura entran GRATIS. Este boleto no incluye acceso a la rampa de nieve. Boleto personal e intransferible. Alimentos, bebidas, mercancía, juegos de destreza, atracciones de nieve y atracciones con costo adicional no están incluidas en el boleto. El acceso a los juegos mecánicos está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones de seguridad de cada juego. Este boleto será válido para usarse una sola vez el día de la visita. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. El acceso al parque se permite hasta una hora antes del cierre del mismo. Compra no reembolsable o modificable una vez confirmada.', 389.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 1140, 1)
   , (10120621, 1, 1, 'Diamond Pass 2024', 'Disfrutavisitas ilimitadas, estacionamiento Diamond sin costo, beneficios exclusivos, descuentos y más conforme a calendario operativo en todos los parques Six Flags por lo que resta de 2023 y todo el año 2024, incluyendo Festival del Terror y Christmas In the Park.Válido al 31 de diciembre de 2024. El Pase debe ser activado en Six Flags México antes de ser utilizado en otros parques y antes de poder utilizar los beneficios incluidos. Consulta los beneficios y los Términos y Condiciones de Pases 2024 previo a confirmar tu compra. Niñas y niños menores de 90 cm de estatura entran GRATIS a Six Flags México y Hurricane Harbor Oaxtepec. Alimentos, souvenirs, juegos de destreza, atracciones con costo adicional y eventos especiales no están incluidos en el Pase. El Acceso a juegos mecánicos, toboganes y atracciones está sujeto a disponibilidad, condiciones climáticas, mantenimiento y a las restricciones de seguridad de cada juego. Compra no reembolsable o modificable una vez confirmada. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. ', 2800.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 111, 1)
   , (10123094, 1, 1, 'Diamond Pass 2024', 'Disfrutavisitas ilimitadas, estacionamiento Diamond sin costo, beneficios exclusivos, descuentos y más conforme a calendario operativo en todos los parques Six Flags por lo que resta de 2023 y todo el año 2024, incluyendo Festival del Terror y Christmas In the Park.Válido al 31 de diciembre de 2024. El Pase debe ser activado en Six Flags México antes de ser utilizado en otros parques y antes de poder utilizar los beneficios incluidos. Consulta los beneficios y los Términos y Condiciones de Pases 2024 previo a confirmar tu compra. Niñas y niños menores de 90 cm de estatura entran GRATIS a Six Flags México y Hurricane Harbor Oaxtepec. Alimentos, souvenirs, juegos de destreza, atracciones con costo adicional y eventos especiales no están incluidos en el Pase. El Acceso a juegos mecánicos, toboganes y atracciones está sujeto a disponibilidad, condiciones climáticas, mantenimiento y a las restricciones de seguridad de cada juego. Compra no reembolsable o modificable una vez confirmada. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. ', 2160.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 1047, 1)
   , (10123274, 10, 1, 'Flash Pass Platino', '10 accesos por fila rápidaEste producto no incluye la entrada al parque. Flash Pass es aplicable en juegos mecánicos participantes y el acceso a los mismos está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones establecidas en nuestra Guía de Seguridad y Accesibilidad. Presenta tu código de barras en la entrada de los 10 juegos mecánicos que hayas elegido para ingresar por fila preferente. Compra no reembolsable ni modificable una vez confirmada. Es individual e intransferible. La reventa de este producto implicará la cancelación del mismo sin derecho a reembolso. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago.', 250.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 241, 1)
   , (10123096, 1, 1, 'Gold Summer Pass 2024', '¡Obtén visitas ilimitadas a Six Flags México! También, recibirás beneficios como estacionamiento sin costo, descuentos en mercancía y más. Consulta restricciones,beneficios, términos y condiciones previa compra. El Pase vence el 8 de septiembre de 2024.Niñas y niños menores de 90 cm de estatura entran gratis. Alimentos, bebidas, mercancía,juegos de destreza, atracciones de terror o nieve y atracciones con costo adicional noestán incluidas en el Pase. El acceso a los juegos mecánicos y atracciones está sujetoa disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones deseguridad de cada juego. El Pase otorga un solo acceso al parque por día de visita.Presenta el código de barras de tu compra en el Módulo de Activación de Pases. Losbeneficios del Pase serán válidos hasta ser activado. Para validar la compra, puedesolicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago.El acceso al parque se permite hasta una hora antes del cierre del mismo. Compra noreembolsable o modificable una vez confirmada. Consulta nuestros horarios en: https://www.sixflags.com.mx/mexico/plan-your-visit/park-hours', 750.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1494, 1)
   , (10095479, 1, 1, 'Junior Pass', 'Junior Pass es válido únicamente para personas menores de 1.07 m.La altura se comprobará en el parque al momento de tu llegada.Con tu Pase tendrás acceso al parque y podrás utilizarlo hasta el 31 de diciembre del 2022.Prohibida su venta.Para conocer calendario operativo y lugares donde redimir tu Pase, visita sixflags.com/pass.No es válido para eventos privados o especiales.El beneficio de Junior Pass para los Socios de Ultimate y Extreme Pass únicamente será válido para personas menores de 1.07 m.La altura se comprobará en el parque al momento de tu llegada.Con este Pase tendrás acceso al parque y podrás utilizarlo hasta el 31 de diciembre del 2023.Consulta el Portal de Socios para obtener más detalles.', 0.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 677, 1)
   , (10062365, 10, 1, 'Membresía con Depósito Reembolsable', 'Membresía con Depósito', 200.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1289, 1)
   , (10062464, 3, 1, 'Membresias Dining Basico', 'Con la Membresia Deluxe de alimentos obtienes una comida y un snack en cada visita en Six Flags Mexico. Oferta valida para membresia de alimentos.Precio es por membresia. Despues de 12 meses la membresia podra ser cancelada en cualquier momento.  La membresia es valida hasta ser canceladas. Valido en cualquier parque tematico de Six Flags y Parque Acuatico.', 64.66, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 402, 1)
   , (10062465, 3, 1, 'Membresias Dining Deluxe', 'Con la Membresia Deluxe de alimentos obtines una comida, una cena y un snack en cada visita en cada visita en Six Flags Mexico. Oferta valida para membresia de alimentos.Precio es por membresia. Despues de 12 meses la membresia podra ser cancelada en cualquier momento.  La membresia es valida hasta ser canceladas. Valido en cualquier parque tematico de Six Flags y Parque Acuatico.', 77.59, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1269, 1)
   , (10062466, 3, 1, 'Membresias Dining Premium', 'Con la MembresiaPremium de alimentos obtines una comida y un snack en cada visita en cualquier  parque tematico de Six Flags y Parque Acuatico, ademas recibe un vaso souvenir gratis al momento de adquirir tu pase anua de alimentos premium. Oferta valida para membresia de alimentos.Precio es por membresia. Despues de 12 meses la membresia podra ser cancelada en cualquier momento.  La membresia es valida hasta ser canceladas. Valido en cualquier parque tematico de Six Flags y Parque Acuatico.', 94.83, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 1136, 1)
   , (10116996, 3, 1, 'Pase de dos Comidas', 'Llénate de energía agregando a tu pase anual dos comidas. Disfruta de comida y cena desde hoy y todo 2024Los pases de alimentos están disponibles para los Socios de pase Anual y se pueden agregar a tu pase (se compran por separado) Válido en todos los parques. Los impuestos pueden ser agregados a este producto. No válido para Picnic. Los productos elegibles se verán identificados en los menús de los restaurantes. Las bebidas no están incluídas. Los restaurantes y alimentos elegibles están sujetos a disponibilidad y pueden cambiar sin previo aviso. ', 2671.55, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 956, 1)
   , (10116997, 3, 1, 'Pase de dos Comidas', '¡Ahorra por tiempo limitado comprándolo en línea! Llénate de energía agregando alimentos a tu Pase 2024 y disfruta DOS deliciosas comidas en cada una de tus visitas durante la vigencia de tu Pase.Este Plan de Alimentos puede agregarse en una sola ocasión a cada Pase y sólo podrá agregarse a Pases 2024. Elige entre opciones como: Pizza, Hamburguesas, Ensaladas, Pastas y mucho más. El Plan de Alimentos es personal e intransferible. Acude al Módulo de Activación de Pases para solicitar añadir tu Plan de Alimentos a tu Pase 2024. Bebidas no incluidas. Queda prohibida la reventa de beneficios. El Plan de Alimentos y Pase 2024 quedarán cancelados en caso de mal uso. Consulta los restaurantes y comidas aplicables en el siguiente menú: https://static.sixflags.com/website/files/Plan-de-Alimentos.pdf El Plan de Alimentos será válido en todos los parques a los que tiene acceso tu Pase 2024. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. Compra no reembolsable o modificable una vez confirmada.', 3361.21, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 193, 1)
