   , (10120579, 1, 1, 'Platinum Pass 2024', '¡Obtén visitas ilimitadas a Six Flags México y Hurricane Harbor Oaxtepec! También,recibirás beneficios como estacionamiento sin costo, descuentos en mercancía y más.Consulta restricciones, beneficios, términos y condiciones previa compra. El Pase vence el 31 de diciembre de 2024.Niñas y niños menores de 90 cm de estatura entran gratis. Alimentos, bebidas, mercancía,juegos de destreza, atracciones de terror o nieve y atracciones con costo adicional noestán incluidas en el Pase. El acceso a los juegos mecánicos y atracciones está sujetoa disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones deseguridad de cada juego. El Pase otorga un solo acceso al parque por día de visita.Presenta el código de barras de tu compra en el Módulo de Activación de Pases. Losbeneficios del Pase serán válidos hasta ser activado. Para validar la compra, puedesolicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago.El acceso al parque se permite hasta una hora antes del cierre del mismo. Compra noreembolsable o modificable una vez confirmada. Consulta nuestros horarios en: https://www.sixflags.com.mx/mexico/plan-your-visit/park-hours', 929.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1127, 1)
   , (10123095, 1, 1, 'Platinum Pass 2024', 'Disfrutavisitas ilimitadas, estacionamiento sin costo, beneficios exclusivos, descuentos y más conforme a calendario operativo en todos los parques Six Flags por lo que resta de 2023 y todo el año 2024, incluyendo Festival del Terror y Christmas In the Park.Válido al 31 de diciembre de 2024. El Pase debe ser activado en Six Flags México antes de ser utilizado en otros parques y antes de poder utilizar los beneficios incluidos. Consulta la lista completa de beneficios previa compra https://www.sixflags.com.mx/mexico/store/tickets/"AQUÍ.  Niñas y niños menores de 90 cm de estatura entran GRATIS a Six Flags México. Alimentos, souvenirs, juegos de destreza, atracciones con costo adicional y eventos especiales no están incluidos en el Pase. El Acceso a juegos mecánicos, toboganes y atracciones está sujeto a disponibilidad, condiciones climáticas, mantenimiento y a las restricciones de seguridad de cada juego. Compra no reembolsable o modificable una vez confirmada. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. ', 899.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 136, 1)
   , (10089830, 10, 1, 'Tu amigo paga $549', '¡Trae a un amigo por sólo $549.00! Selecciona cuántos boletos deseas comprar de acuerdo al límite del beneficio. Cada socio de pase DEBE estar presente. La admisión de tu amigo se cargará en tu credencial, por lo que deben ingresar juntos al parque cuando se escanee tu credencial.Este boleto será válido sólo para el día de visita seleccionado. Toma en cuenta que este boleto no se mostrará al final de esta transacción, ya que la admisión del amigo se cargará en tu credencial de pase.', 549.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 1040, 1)
