   , (10123466, 4, 1, 'VIP Kids Christmas In the Park', 'Válido únicamente para menores de 1.20 m de estatura. Este boleto será válido únicamente en la fecha seleccionada al realizar la compra. Consulta estaturas requeridas para juegos mecánicos, beneficios, términos y condiciones previa compra.Cada VIP Kids Christmas In the Park brinda acceso al parque a una persona menor de 1.20 m de estatura en la fecha seleccionada, así como a los juegos mecánicos de forma ilimitada por fila rápida el día de la visita, acceso ilimitado a la rampa de nieve y una cena VIP. Este boleto es personal e intransferible y el uso del mismo estará sujeto a la medición de estatura del menor. Mercancía, juegos de destreza y atracciones con costo adicional no están incluidas en el boleto. El acceso a los juegos mecánicos es por orden de llegada, está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones de seguridad establecidas. Consulta los horarios de operación. Niñas y niños menores de 90 cm de estatura no pagan entrada al parque. La compra no será reembolsable ni modificable una vez confirmada. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago.', 899.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 812, 1)
   , (10100694, 2, 1, 'VIP Nanny', 'Tu VIP nanny incluye: admisión al parque, brazalete VIP para acceso a fila rápida a juegos mecánicos, una comida, dos snacks, bebidas, asistencia de nanny privada (7 horas) y mucho más! Máximo 2 niños/niñas por grupo, de 6 a 12 años de edadAcceso a juegos mecánicos sujeto a disponibilidad y restricciones de seguridad. No aplican reembolsos. IMPORTANTE: Después de reservar, envía un correo electrónico con tu nombre, número telefónico y número de confirmación de compra a: nmartinez@sftp.com para confirmar tu visita. Esto debe hacerse con un mínimo de 48 horas antes de la fecha de visita.  Uno de nuestros representantes del programa se comunicará contigo para confirmar los detalles de tu visita y te brindará información necesaria. Para validar la compra en el parque, puede solicitarse la presencia del titular con la tarjeta bancaria e identificación oficial.', 4000.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1312, 1)
   , (10105263, 1, 1, '2023 Platinum Pass', '¡Obtén visitas ilimitadas a todos los parques de Six Flags, además de Hurricane Harbor Oaxtepec! También, recibirás beneficios exclusivos como estacionamiento sin costo, descuentos en comida y souvenirs seleccionados y más.El pase vence el 31 de diciembre de 2023.  No incluye el consumo de alimentos, bebidas, mercancía, juegos de destreza, atracciones con costo adicional, conciertos o eventos especiales. ', 749.25, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1411, 1)
