   , (10104076, 3, 1, 'Plan de Alimentos - 2 Comidas', 'Con este Plan Anual de Alimentos, recarga batería todo el año. Disfruta comida y cena en cada visita durante la vigencia de tu Pase. Los impuestos se verán reflejados previa compra.Este Plan de Alimentos expira el al mismo tiempo que el Pase al que fue asignado.¡Disfruta 2 comidas en cada visita! Sólo con 90 minutos de intervalo entre cada comida. Las bebidas no están incluidas. Sujeto a disponibilidad de menú y restaurantes. Válido únicamente en Six Flags México.  Los Planes de Alimentos están disponibles sólo para socios de Gold Pass, Platinum Pass y Diamond Pass y se agregarán a tu credencial (se compran por separado). Son personales e instranferibles. Las comidas disponibles se verán identificadas en el menú de cada restaurante o en el menú "Guía Plan de Alimentos" del siguiente link: https://www.sixflags.com.mx/mexico/things-to-do/restaurants', 2999.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 158, 1)
   , (10099349, 3, 1, 'Plan de Alimentos - 2 comidas', 'Disfruta de 2 comidas en cada visita durante la vigencia del Plan Anual asociado y sólo en los parques a los que tiene acceso. 3 horas de intervalo entre cada redención de comida. No incluye bebidas. Aplica en restaurantes y comidas seleccionados, sujeto a disponibilidad. Los impuestos y cargos se verán reflejados previa confirmación de compra.Este Plan de Alimentos expira cuando vence el Plan Anual asociado.¡Disfruta 2 comidas en cada visita durante todo el año 2023! Sólo con 3 horas de intervalo entre cada comida. Las bebidas no están incluidas. Sujeto a disponibilidad de menú y restaurantes. Válido únicamente en Six Flags México y Hurricane Harbor Oaxtepec.  Los Planes de Alimento están disponibles sólo para socios de pases y se agregarán a tu credencial (se compran por separado). Son personales e instranferibles. IVA incluido. Las comidas disponibles se verán identificadas en el menú de cada restaurante.', 2999.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 1415, 1)
   , (80004519, 6, 1, 'Socio Gold Plus (4+) c/3 meses gratis', ' Inscríbete para una Membresía GOLD PLUS hoy y ahorra hasta un 50% del precio regular, MÁS tres meses adicionales al final de tu membresía. Nuestra nueva Membresía Gold Plus ofrece más valor, más descuentos y más beneficios exclusivos de los que ofrecemos en nuestros mejores Pases Anuales y a un precio mucho más bajo.  Como socio Gold Plus, recibirás todos los beneficios de un Pase Anual Gold, más los siguientes beneficios:      Acceso ilimitado a los parques Six Flags   Estacionamiento en todos los parques Six Flags (ahorre $200 por visita)   Más docenas de beneficios adicionales. Consulta el sitio web para obtener más detalles.    Regístrate para obtener una Membresía a través de esta promoción y agregaremos tres meses adicionales de Membresía gratis a tu cuenta inmediatamente después de tu último mes pagado. Para recibir tus meses adicionales gratuitos, debes estar al día con los pagos de tu membresía y solicitar tu cancelación a través de nuestro proceso de cancelación regular. Los complementos como Pase de Alimentos y Pase Flash Pass no están incluidos en esta oferta especial y no se extenderán automáticamente al período gratuito. En lugar de tres meses gratis, los miembros que permanezcan en el programa 48 meses recibirán un crédito en el parque equivalente a tres meses de sus cuotas de membresía mensuales regulares (no incluye complementos como Comidas para socios o Flash Pass para socios).   Las membresías deben recogerse en Six Flags México antes de que visites otros parques. Los niños menores de dos años entran gratis. Las membresías pueden cancelarse en cualquier momento después de los primeros 12 meses. Lea atentamente el Contrato de Membresía.  ', 59.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 971, 4)
   , (10123467, 4, 1, 'VIP Kids Christmas In the Park', 'Válido únicamente para menores de 1.20 m de estatura. Este boleto será válido únicamente en la fecha seleccionada al realizar la compra. Consulta estaturas requeridas para juegos mecánicos, beneficios, términos y condiciones previa compra.Cada VIP Kids Christmas In the Park brinda acceso al parque a una persona menor de 1.20 m de estatura en la fecha seleccionada, así como a los juegos mecánicos de forma ilimitada por fila rápida el día de la visita, acceso ilimitado a la rampa de nieve y una cena VIP. Este boleto es personal e intransferible y el uso del mismo estará sujeto a la medición de estatura del menor. Mercancía, juegos de destreza y atracciones con costo adicional no están incluidas en el boleto. El acceso a los juegos mecánicos es por orden de llegada, está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones de seguridad establecidas. Consulta los horarios de operación. Niñas y niños menores de 90 cm de estatura no pagan entrada al parque. La compra no será reembolsable ni modificable una vez confirmada. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago.', 450.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1298, 1)
   , (10102070, 2, 1, 'VIP Tour', 'Tu experiencia VIP Tour incluye: admisión VIP al parque, estacionamiento preferente, tour privado con guía durante la visita y brazalete VIP para acceso rápido a los juegos mecánicos.  Este boleto será válido únicamente en la fecha seleccionada al realizar la compra. Consulta beneficios, términos y condiciones previa compra.Además incluye: Una comida, un snack, una playera souvenir y bebidas ilimitadas (no alcohólicas). Este boleto NO incluye acceso a las Atracciones de Terror. El acceso a los juegos mecánicos está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y restricciones de seguridad. Se requiere un mínimo de 4 personas para contratar un tour. Consulta los horarios de operación. Niñas y niños menores de 90 cm de estatura no pagan entrada al parque.  La compra no será reembolsable ni modificable una vez confirmada. IMPORTANTE: Después de completar tu compra, envía tu nombre, número telefónico, y número de confirmación a la dirección: nmartinez@sftp.com con 48 horas de anticipación. Un guía turístico se comunicará contigo para confirmar tu visita y brindarte atención personalizada.', 4000.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 67, 4)
   , (10105272, 1, 1, '2023 Diamond Pass', '¡Obtén visitas ilimitadas a todos los parques de Six Flags, además de Hurricane Harbor Oaxtepec! También, recibirás beneficios exclusivos como estacionamiento sin costo, descuentos en souvenirs seleccionados, descuentos en Planes de Alimentos y más. Incluye acceso a Christmas in the Park 2022.El pase vence en el primer aniversario de la fecha de compra. No incluye el consumo de alimentos, bebidas, mercancía, juegos de destreza, atracciones con costo adicional, conciertos o eventos especiales.', 1274.25, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 319, 1)
   , (10105274, 2, 1, 'Boleto de un día', 'Válido para una admisión a Six Flags México en el día y horario de operación seleccionado. No aplican reembolsos ni cancelaciones.Tu boleto es personal e intransferible. Niños menores de 90 cm entran gratis. Válido por un día de visita con acceso a todos los juegos mecánicos. No incluye juegos de destreza o ningún tipo de atracción con costo adicional. CUPO LIMITADO. EL TITULAR DEBERÁ PRESENTAR IDENTIFICACIÓN OFICIAL Y TARJETA CON LA QUE FUE REALIZADA LA COMPRA.', 499.50, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 28, 1)
   , (10082147, 2, 1, 'Boleto de un Día', 'Válido para una Admisión General a Six Flags México únicamente para el día seleccionado en la compra. Niñas y niños menores de 90 cm de estatura entran GRATIS. Este boleto no incluye acceso a las Atracciones de Terror de Festival del Terror.Boleto personal e intransferible. Alimentos, bebidas, mercancía, juegos de destreza y atracciones con costo adicional no están incluidas en el boleto. El acceso a los juegos mecánicos está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones de seguridad de cada juego. Este boleto será válido para usarse una sola vez el día de la visita. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. El acceso al parque se permite hasta una hora antes del cierre del mismo. Compra no reembolsable o modificable una vez confirmada. Si requieres acceso a las Atracciones de Terror de Festival del Terror, puedes adquirir el combo "Boleto de un día + Pase de Atracciones de Terror", o comprarlo por separado.', 649.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 8, 1)
