   , (10117384, 1, 1, 'Platinum Pass 2024 - 6 Flx', 'Disfrutavisitas ilimitadas, estacionamiento sin costo, beneficios exclusivos, descuentos y más conforme a calendario operativo en todos los parques Six Flags por lo que resta de 2023 y todo el año 2024, incluyendo Festival del Terror y Christmas In the Park.Válido al 31 de diciembre de 2024. El Pase debe ser activado en Six Flags México antes de ser utilizado en otros parques y antes de poder utilizar los beneficios incluidos. Consulta los beneficios y los Términos y Condiciones de Pases 2024 previo a confirmar tu compra.Niñas y niños menores de 1.20 m de estatura entran GRATIS (hasta el 10 de septiembre de 2023) a Six Flags México. Alimentos, souvenirs, juegos de destreza, atracciones con costo adicional y eventos especiales no están incluidos en el Pase. El Acceso a juegos mecánicos, toboganes y atracciones está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones de seguridad de cada juego. Compra no reembolsable o modificable una vez confirmada. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. ', 1099.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 628, 1)
   , (10117734, 2, 1, 'Boleto de un Día', 'Válido para una Admisión General a Six Flags México únicamente para el día seleccionadoen la compra. Niñas y niños menores de 90 cm de estatura entran GRATIS.Boleto personal e intransferible. Alimentos, bebidas, mercancía, juegos de destreza,atracciones de terror o nieve y atracciones con costo adicional no están incluidas en elboleto. El acceso a los juegos mecánicos está sujeto a disponibilidad, condicionesmeteorológicas, mantenimiento y a las restricciones de seguridad de cada juego. Esteboleto será válido para usarse una sola vez el día de la visita. Para validar la compra,puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó elpago. El acceso al parque se permite hasta una hora antes del cierre del mismo. Comprano reembolsable o modificable una vez confirmada.', 1099.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 985, 1)
