   , (10087884, 4, 1, 'VIP Christmas In the Park', 'Vive una experiencia exclusiva en tu visita a Christmas In thePark Este boleto será válido únicamente en la fecha seleccionada al realizar lacompra. Consulta beneficios, términos y condiciones previa compra.Cada VIP Christmas In the Park brinda acceso a una persona al parque enla fecha seleccionada, así como a los juegos mecánicos de forma ilimitada por fila rápida eldía de la visita y una cena VIP. Este boleto es personal e intransferible. Mercancía, juegosde destreza y atracciones con costo adicional no están incluidas en el boleto. El acceso alos juegos mecánicos es por orden de llegada, está sujeto a disponibilidad, condicionesmeteorológicas, mantenimiento y a las restricciones de seguridad establecidas.Consulta los horarios de operación. Niñas y niños menores de 90 cm de estaturano pagan entrada al parque.  La compra no será reembolsable ni modificable unavez confirmada. Para validar la compra, puede solicitarse la presencia del titular con suidentificación y tarjeta con la que realizó el pago.', 2800.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 487, 1)
