   , (10123262, 10, 1, 'Flash Pass Regular', '3 accesos por fila rápidaEste producto no incluye la entrada al parque. Flash Pass es aplicable en juegos mecánicos participantes y el acceso a los mismos está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y a las restricciones establecidas en nuestra Guía de Seguridad y Accesibilidad. Presenta tu código de barras en la entrada de los 3 juegos mecánicos que hayas elegido para ingresar por fila preferente. Compra no reembolsable ni modificable una vez confirmada. Es individual e intransferible. La reventa de este producto implicará la cancelación del mismo sin derecho a reembolso. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago.', 100.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 896, 1)
