   , (10118640, 4, 1, 'VIP Tour - Six Flags México', 'Tu experiencia de VIP Tours incluye: admisión al parque, estacionamiento, tour privado con guía durante la visita y brazalete VIP para acceso a filas rápidas de juegos mecánicos (aplica sólo una vez a CraZanity, Wonder Woman y Kilahuea).Además incluye: Una comida o cena y un snack (de acuerdo al día de la visita), una playera souvenir, acceso a Go karts, Sling Shot o X flight (sujeto a disponibilidad) y vaso souvenir del año en curso con refill ilimitado el día del tour. El costo es por persona y se requiere un mínimo de 4 personas. Acceso a juegos mecánicos sujeto a disponibilidad y restricciones de seguridad. No aplican reembolsos.  IMPORTANTE: Después de reservar, envía un correo electrónico con tu nombre, número telefónico y número de confirmación de compra a: nmartinez@sftp.com para confirmar tu visita. Esto debe hacerse con un mínimo de 48 horas antes de la fecha de visita. Un guía turístico VIP se comunicará contigo para confirmar los detalles de tu visita y te brindará información necesaria. Puede solicitarse la presencia del titular de la compra, con la tarjeta bancaria e identificación oficial.', 5000.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 480, 4)
