   , (10051690, 2, 2, 'Admisión General Hurricane Harbor Oaxtepec', 'Válido para una Admisión General a Hurricane Harbor Oaxtepec sólo para el día seleccionado en la compra. (no podrá ser utilizado en ninguna otra fecha ni modificado). No aplican reembolsos ni cancelaciones por ningún motivo.Boleto personal e intransferible. No incluye el consumo de alimentos, bebidas, mercancía o atracciones con costo adicional. Niñas y niños menores de 1.20 m de estatura entran GRATIS El acceso a los toboganes y atracciones está sujeto a disponibilidad, condiciones climáticas, mantenimiento y a las restricciones de seguridad. No se cuenta con reingresos al parque. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. Consulta calendario operativo y horarios en: https://www.sixflags.com.mx/hurricaneharborox/plan-your-visit/park-hours', 421.94, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 998, 1)
