   , (10078450, 7, 2, 'Bimini - Hurricane Bay', 'Disfruta mejor de tu día en Hurricane Harbor Oaxtepec con un Bimini para dos personas. ¡Ubicado frente a la alberca de olas! La renta de un Bimini incluye dos camastros y una pequeña mesa.La renta de biminis no es reembolsable, sin excepciones. Espacio para un límite de 2 personas (menores de 90 cm. excluídos). Debido al cupo limitado, si no te presentas en el día seleccionado, antes de las 14:00 hrs., tu reservación será cancelada, sin ningún tipo de reembolso. Únicamente se puede reservar un bimini en cada compra.', 129.31, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 808, 1)
   , (10107715, 7, 2, 'Bimini - Hurricane Bay $250', 'Disfruta mejor de tu día en Hurricane Harbor Oaxtepec con un Bimini para dos personas. ¡Ubicado frente a la alberca de olas! La renta de un Bimini incluye dos camastros y una pequeña mesa.La renta de biminis no es reembolsable, sin excepciones. Espacio para un límite de 2 personas (menores de 90 cm. excluídos). Debido al cupo limitado, si no te presentas en el día seleccionado, antes de las 14:00 hrs., tu reservación será cancelada, sin ningún tipo de reembolso. Únicamente se puede reservar un bimini en cada compra.', 215.52, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 922, 1)
   , (10091426, 2, 2, 'Boleto de un dia', ' Válido para una admisión a [Hurricane Harbor Ox] en [Oaxtepec, Morelos] en los días y horarios de operación programados. Tu boleto es personal e intransferible. Niños menores de 90 cm entran gratis. Válido por un día de visita con acceso a todas las atracciones acuáticas. Por favor revisa los días y horarios de operación del parque para que puedas programar tu visita en sixflags.com.mx/es/hurricaneharborox No hay cambios ni devoluciones. CUPO LIMITADO. EL TITULAR DEBERÁ PRESENTAR IDENTIFICACIÓN OFICIAL Y TARJETA CON LA QUE FUE REALIZADA LA COMPRA.', 0.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 849, 1)
   , (10078449, 7, 2, 'Cabana Estándar', '¿Buscas una zona exclusiva para relajarte Mejora tu visita a Hurricane Harbor Oaxtepec en una cabana privada, con espacio hasta para 4 personas. Ubicada cerca de nuestras principales atracciones. Incluye 2 camastros, 2 sillas, una mesa, un locker y una hielera con 4 botellas de agua.La renta de cabanas no es reembolsable, sin excepciones. Debido al cupo limitado, si no te presentas en el día seleccionado, antes de las 14:00 hrs., tu reservación será cancelada, sin ningún tipo de reembolso. Únicamente se puede reservar una cabana en cada compra.', 215.52, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 300, 1)
   , (10096638, 7, 2, 'Cabana Platino $800', '¿Buscas una zona exclusiva para relajarte Mejora tu visita a Hurricane Harbor Oaxtepec en una cabana privada, con espacio hasta para 5 personas. Ubicada cerca de " ". Incluye 2 camastros, 3 sillas, una mesa, un locker y 5 botellas de agua. Además, puedes ingresar tus propios alimentos en una hielera (tamaño máximo 63.5x35.5x35.5 centímetros).La renta de cabanas no es reembolsable, sin excepciones. Debido al cupo limitado, si no te presentas en el día seleccionado, antes de las 14:00 hrs., tu reservación será cancelada, sin ningún tipo de reembolso. Únicamente se puede reservar una cabana en cada compra. No se permite ningún tipo de vidrio, bebida alcohólica ni botella abierta en la hielera.', 689.66, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 943, 1)
   , (10120620, 1, 2, 'Diamond Pass 2024', 'Disfrutavisitas ilimitadas, estacionamiento Diamond sin costo, beneficios exclusivos, descuentos y más conforme a calendario operativo en todos los parques Six Flags por lo que resta de 2023 y todo el año 2024, incluyendo Festival del Terror y Christmas In the Park.Válido al 31 de diciembre de 2024. El Pase debe ser activado en Hurricane Harbor Oaxtepec antes de ser utilizado en otros parques y antes de poder utilizar los beneficios incluidos. Consulta la lista completa de beneficios previa compra  https://www.sixflags.com.mx/hurricaneharborox/store/tickets/"AQUÍ.  Niñas y niños menores de 1.20 m de estatura entran GRATIS a Hurricane Harbor Oaxtepec. Alimentos, souvenirs, juegos de destreza, atracciones con costo adicional y eventos especiales no están incluidos en el Pase. El Acceso a juegos mecánicos, toboganes y atracciones está sujeto a disponibilidad, condiciones climáticas, mantenimiento y a las restricciones de seguridad de cada juego. Compra no reembolsable o modificable una vez confirmada. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. ', 2362.87, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 698, 1)
