   , (10075795, 8, 2, 'Estacionamiento de un día', 'Estacionamiento de un día válido para un automóvil de tamaño regular en el día operativo seleccionado en su compra. No incluye Vans, ni Autobuses (el costo se cubre en taquillas del parque). El estacionamiento está sujeto a disponibilidad.El mal uso de este servicio ocasionará la cancelación del Pase Anual, Membresía o Boleto de un día y en la expulsión del parque sin reembolso alguno. ', 76.72, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1389, 1)
   , (10112783, 2, 2, 'Experiencia VIP', 'Válido para una Admisión VIP a Hurricane Harbor Oaxtepec sólo para el día seleccionado en la compra. Niños y niñas menores de 1.20 m de estatura entran GRATIS (Admisión General). Incluye acceso más rápido a los toboganes ilimitadamente. Incluye una comida a elegir y un refresco mediano.Boleto personal e intransferible. El acceso a los toboganes y atracciones está sujeto a disponibilidad, condiciones climáticas, mantenimiento y a las restricciones de seguridad. Acceso rápido no válido en Adventure River. Este boleto será válido para ingresar al parque una sola vez el día de la visita. Consulta las 3 opciones de comida entre las que podrás elegir. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. El acceso al parque se permite hasta una hora antes del cierre del mismo. Compra no reembolsable o modificable una vez confirmada. Prohibida su reventa. Consulta nuestros horarios en: https://www.sixflags.com.mx/hurricaneharborox/plan-your-visit/park-hours', 666.67, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 126, 1)
   , (10097224, 10, 2, 'Extreme Anual Pass 2022', 'Visitas ilimitadas a todos los parques de Six Flags, además de Hurricane Harbor Oaxtepec - ¡sin fechas bloqueadas! También, recibirás beneficios exclusivos como estacionamiento sin costo, descuentos en comida y souvenirs seleccionados y más.El pase caduca en el primer aniversario de la fecha de compra', 590.72, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 686, 1)
