   , (10120593, 7, 2, 'Food Garden', '¡Renta tu zona privada! Podrás ingresar tus propios alimentos en una hielera y disfrutarlos en la zona asignada. Máximo para 8 personas. IMPORTANTE: Deberás acudir a Atención al Visitante con tu comprobante de compra para poder asignarte tu zona Food Garden. No se permiten alimentos que requieran calentarse o algún proceso de cocción.El tamaño máximo de la hielera es de 63.5" x 35.5 x 35.5 centímetros (48 cuartos). Renta válida sólo en la fecha seleccionada. No se permite ningún tipo de vidrio o metal, bebida alcohólica ni botella abierta (no sellada). Todos los alimentos deben ingresar dentro de la hielera, la cual deberá ingresar cerrada. Se requerirá revisión física de la hielera y que pase por el sistema de rayos x. Renta válida únicamente para el día seleccionado. Prohibida su reventa o reproducción. No aplican reembolsos ni cambios de fecha. Esta renta no incluye el acceso al parque.', 258.62, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 847, 1)
   , (10118248, 1, 2, 'Gold Summer Pass 2024', '¡Obtén visitas ilimitadas a Hurricane Harbor Oaxtepec! También, recibirás beneficios como estacionamiento sin costo, descuentos en mercancía y más. Consulta restricciones,beneficios, términos y condiciones previa compra. El Pase vence el 8 de septiembre de 2024.Niñas y niños menores de 90 cm de estatura entran gratis. Alimentos, bebidas, mercancíay atracciones con costo adicional no están incluidas en el Pase. El acceso a los toboganes yatracciones está sujeto a disponibilidad, condiciones meteorológicas, mantenimiento y alas restricciones de seguridad de cada uno. El Pase otorga un solo acceso al parque por díade visita. Presenta el código de barras de tu compra en el Módulo de Activación de Pases.Los beneficios del Pase serán válidos hasta ser activado. Para validar la compra, puedesolicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago.El acceso al parque se permite hasta una hora antes del cierre del mismo. Compra noreembolsable o modificable una vez confirmada. Consulta nuestros horarios en: https://www.sixflags.com.mx/hurricaneharborox/plan-your-visit/park-hours', 465.52, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 78, 1)
