   , (10100054, 1, 2, 'Plan Anual - Gold Pass', 'Obtén visitas ilimitadas a Six Flags México. ¡Además, disfruta de exclusivos beneficios como estacionamiento sin costo, 1 Flash Pass (al año) y más! Incluye acceso a Festival del Terror y Christmas in the Park 2022El pase vence en el primer aniversario de la fecha de compra. No incluye el consumo de alimentos, bebidas, mercancía, juegos de destreza, atracciones con costo adicional, conciertos o eventos especiales.', 465.52, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 971, 1)
   , (10100774, 3, 2, 'Plan de 1 Alimentos', 'Con este Plan Anual de Alimentos, recarga batería todo el año. Disfruta comida en cada visita durante todo el 2023Este Plan de Alimentos expira cuando vence el Plan Anual asociado.¡Disfruta 1 comidas en cada visita durante todo el año 2023!  Las bebidas no están incluidas. Sujeto a disponibilidad de menú y restaurantes. Válido únicamente en Six Flags México y Hurricane Harbor Oaxtepec.  Los Planes de Alimento están disponibles sólo para socios de pases y se agregarán a tu credencial (se compran por separado). Son personales e instranferibles. IVA incluido. Las comidas disponibles se verán identificadas en el menú de cada restaurante.', 1399.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 725, 1)
