   , (10099290, 3, 2, 'Plan de 2 Alimentos 2023', 'Con este Plan Anual de Alimentos, manténte alimentado todo el año. Disfruta comida y cena en cada visita durante todo el 2023Este Plan de Alimentos expira cuando vence el Plan Anual asociado.¡Disfruta 2 comidas en cada visita durante todo el año 2023! Sólo con 3 horas de intervalo entre cada comida. Las bebidas no están incluidas. Sujeto a disponibilidad de menú y restaurantes. Válido únicamente en Six Flags México y Hurricane Harbor Oaxtepec.  Los Planes de Alimento están disponibles sólo para socios de pases y se agregarán a tu credencial (se compran por separado). Son personales e instranferibles. IVA incluido. Las comidas disponibles se verán identificadas en el menú de cada restaurante.', 2699.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 544, 1)
   , (10104584, 3, 2, 'Plan de Alimentos - 1 Comida', 'Con este Plan de Alimentos recarga batería todo el año. Disfruta 1 comida en cada visita durante la vigencia de tu Pase. Los impuestos se verán reflejados previa compra.Este Plan de Alimentos expira al mismo tiempo que el Pase al que fue asignado.¡Disfruta 1 comida en cada visita! Las bebidas no están incluidas. Sujeto a disponibilidad de menú y restaurantes. Válido únicamente en Six Flags México.  Los Planes de Alimentos están disponibles sólo para socios de Gold Pass, Platinum Pass y Diamond Pass y se agregarán a tu credencial (se compran por separado). Son personales e instranferibles. ', 1399.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 287, 1)
