   , (10099289, 3, 2, 'Plan de Alimentos - 2 comidas', 'Disfruta de 2 comidas en cada visita durante la vigencia del Plan Anual asociado y sólo en los parques a los que tiene acceso. 3 horas de intervalo entre cada redención de comida. No incluye bebidas. Aplica en restaurantes y comidas seleccionados, sujeto a disponibilidad. Los impuestos y cargos se verán reflejados previa confirmación de compra.Este Plan de Alimentos expira cuando vence el Plan Anual asociado.¡Disfruta 2 comidas en cada visita durante todo el año 2023! Sólo con 3 horas de intervalo entre cada comida. Las bebidas no están incluidas. Sujeto a disponibilidad de menú y restaurantes. Válido únicamente en Six Flags México y Hurricane Harbor Oaxtepec.  Los Planes de Alimento están disponibles sólo para socios de pases y se agregarán a tu credencial (se compran por separado). Son personales e instranferibles. IVA incluido. Las comidas disponibles se verán identificadas en el menú de cada restaurante.', 2999.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 382, 1)
   , (10116534, 3, 2, 'Plan de Alimentos - Dos Comidas', '¡Ahorra por tiempo limitado comprándolo en línea! Llénate de energía agregando alimentos a tu Pase 2024 y disfruta DOS deliciosas comidas en cada una de tus visitas durante la vigencia de tu Pase.Este Plan de Alimentos puede agregarse en una sola ocasión a cada Pase y sólo podrá agregarse a Pases 2024. Elige entre opciones como: Pizza, Hamburguesas, Ensaladas, Pastas y mucho más. El Plan de Alimentos es personal e intransferible. Acude al Módulo de Activación de Pases para solicitar añadir tu Plan de Alimentos a tu Pase 2024. Bebidas no incluidas. Queda prohibida la reventa de beneficios. El Plan de Alimentos y Pase 2024 quedarán cancelados en caso de mal uso. Consulta los restaurantes y comidas aplicables en el siguiente menú: https://static.sixflags.com/website/files/Plan-de-Alimentos.pdf El Plan de Alimentos será válido en todos los parques a los que tiene acceso tu Pase 2024. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. Compra no reembolsable o modificable una vez confirmada.', 3361.21, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 215, 1)
   , (10116516, 3, 2, 'Plan de Alimentos - Una Comida', '¡Ahorra por tiempo limitado comprándolo en línea! Llénate de energía agregando alimentos a tu Pase 2024 y disfruta una deliciosa comida en cada una de tus visitas durante la vigencia de tu Pase.Este Plan de Alimentos puede agregarse en una sola ocasión a cada Pase y sólo podrá agregarse a Pases 2024. Elige entre opciones como: Pizza, Hamburguesas, Ensaladas, Pastas y mucho más. El Plan de Alimentos es personal e intransferible. Acude al Módulo de Activación de Pases para solicitar añadir tu Plan de Alimentos a tu Pase 2024. Bebidas no incluidas. Queda prohibida la reventa de beneficios. El Plan de Alimentos y Pase 2024 quedarán cancelados en caso de mal uso. Consulta los restaurantes y comidas aplicables en el siguiente menú: https://static.sixflags.com/website/files/Plan-de-Alimentos.pdf El Plan de Alimentos será válido en todos los parques a los que tiene acceso tu Pase 2024. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. Compra no reembolsable o modificable una vez confirmada.', 1637.07, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 266, 1)
   , (10104600, 3, 2, 'Plan de Alimentos de un Día', 'Una comida a elegir entre deliciosas y variadas opcionesUn snack a elegir entre churros, crepa, papas a la francesa y másUna bebida a elegir de 473 ml de la familia Coca Cola. Redenciones válidas en locales y restaurantes participantes', 241.38, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 252, 1)
   , (10104617, 3, 2, 'Plan de Alimentos de un Día', 'Disfruta de 1 comida, 1 snack, y 1 bebida de 473 ml o agua embotellada de 600 ml. Elige entre varias opciones como tiras de pollo, hamburguesa, pizza y mucho más. Identifica los alimentos en los menús de los locales participantes ("C" Comida "S" Snack).', 241.38, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1025, 1)
   , (10120581, 1, 2, 'Platinum Pass 2024', '¡Obtén visitas ilimitadas a Six Flags México y Hurricane Harbor Oaxtepec! También,recibirás beneficios como estacionamiento sin costo, descuentos en mercancía y más.Consulta restricciones, beneficios, términos y condiciones previa compra. El Pase vence el 31 de diciembre de 2024.Niñas y niños menores de 90 cm de estatura entran gratis. Alimentos, bebidas, mercancía,juegos de destreza, atracciones de terror o nieve y atracciones con costo adicional noestán incluidas en el Pase. El acceso a los juegos mecánicos, toboganes y atracciones estásujeto a disponibilidad, condiciones meteorológicas, mantenimiento y a las restriccionesde seguridad de cada juego. El Pase otorga un solo acceso al parque por día de visita.Presenta el código de barras de tu compra en el Módulo de Activación de Pases. Losbeneficios del Pase serán válidos hasta ser activado. Para validar la compra, puedesolicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago.El acceso al parque se permite hasta una hora antes del cierre del mismo. Compra noreembolsable o modificable una vez confirmada. Consulta nuestros horarios en: https://www.sixflags.com.mx/mexico/plan-your-visit/park-hours', 800.86, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 585, 1)
   , (10123098, 1, 2, 'Platinum Pass 2024', 'Disfrutavisitas ilimitadas, estacionamiento sin costo, beneficios exclusivos, descuentos y más conforme a calendario operativo en todos los parques Six Flags por lo que resta de 2023 y todo el año 2024, incluyendo Festival del Terror y Christmas In the Park.Válido al 31 de diciembre de 2024. El Pase debe ser activado en Hurricane Harbor Oaxtepec antes de ser utilizado en otros parques y antes de poder utilizar los beneficios incluidos. Consulta la lista completa de beneficios previa compra  https://www.sixflags.com.mx/hurricaneharborox/store/tickets/"AQUÍ.  Niñas y niños menores de 1.20 m de estatura entran GRATIS a Hurricane Harbor Oaxtepec. Alimentos, souvenirs, juegos de destreza, atracciones con costo adicional y eventos especiales no están incluidos en el Pase. El Acceso a juegos mecánicos, toboganes y atracciones está sujeto a disponibilidad, condiciones climáticas, mantenimiento y a las restricciones de seguridad de cada juego. Compra no reembolsable o modificable una vez confirmada. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. ', 775.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1201, 1)
   , (10096631, 7, 2, 'Sillas Reposeras - Big Surf $30', 'No te preocupes por buscar un lugar para relajarte en la sombra. Asegura tu lugar reservando sillas reposeras personales, ¡cerca de Big Surf y nuestras principales atracciones!La renta de sillas no es reembolsable, sin excepciones. Limitado a 1 persona por silla (menores de 90 cm. excluidos). Debido al cupo limitado, si no te presentas en el día seleccionado, antes de las 14:00 hrs., tu reservación será cancelada, sin ningún tipo de reembolso. Únicamente se pueden reservar hasta 4 sillas en cada compra.', 25.86, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1067, 1)
   , (10093994, 7, 2, 'Tent - Hurricane Bay', '¿Buscas una zona exclusiva para relajarte Mejora tu visita a Hurricane Harbor Oaxtepec rentando un Tent con espacio hasta para 4 personas. ¡Ubicado frente a la alberca de olas! Incluye 2 camastros, 2 sillas, una mesa y una hielera con 4 aguas embotelladas.La renta de Tents no es reembolsable, sin excepciones. Debido al cupo limitado, si no te presentas en el día seleccionado, antes de las 14:00 hrs., tu reservación será cancelada, sin ningún tipo de reembolso. Únicamente se puede reservar hasta dos Tents por transacción. La reventa y/o reproducción de este boleto está estrictamente prohibida. ', 344.83, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 835, 1)
   , (10097628, 1, 2, 'Ultimate Anual Pass 2022', 'Visitas ilimitadas a todos los parques de Six Flags, además de Hurricane Harbor Oaxtepec. También, recibirás beneficios exclusivos como estacionamiento sin costo, descuentos en comida y souvenirs seleccionados, plan de 10 comidas y más.El pase caduca en el primer aniversario de la fecha de compra', 3375.53, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1492, 1)
   , (10100695, 2, 2, 'VIP Nanny', '¡Tu VIP nanny incluye: admisión al parque, brazalete VIP para acceso a fila rápida a toboganes y atracciones acuáticas, comidas, bebidas, asistencia de nanny privada (7 horas) y mucho más! Máximo 2 niños/niñas por grupo de 6 a 12 años de edadIMPORTANTE: Después de reservar, envía un correo electrónico con tu nombre, número telefónico y número de confirmación de compra a: polguin@sftp.com para confirmar tu visita.  Esto debe hacerse con un mínimo de 48 horas antes de la fecha de visita. Uno de nuestros representantes del programa se comunicará contigo para confirmar los detalles de tu visita y te brindará información necesaria.', 3375.53, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 1315, 1)
   , (10096432, 2, 2, 'VIP Tour - Hurricane Harbor Oaxtepec', '¡Tu experiencia de VIP Tours incluye: admisión al parque, estacionamiento, tour privado con guía durante la visita y brazalete VIP para acceso a filas rápidas de toboganes.Además incluye: Una comida y un snack, una playera souvenir, vaso souvenir del año en curso con refill ilimitado el día del tour y el uso de una llanta sin costo para Adventure River. El costo es por persona, y se requiere un mínimo de 4 personas.IMPORTANTE: Después de reservar, envía un correo electrónico con tu nombre, número telefónico y número de confirmación de compra a: polguin@sftp.com para confirmar tu visita. Esto debe hacerse con un mínimo de 24 horas antes de la fecha de visita. Un guía turístico VIP se comunicará contigo para confirmar los detalles de tu visita y te brindará información necesaria.', 2109.70, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 402, 4)
   , (10108969, 10, 2, 'Zona de camping', 'Todo lo necesario para que pases una noche cómoda y divertida, y despiertes listo para un día lleno de emociones y adrenalina en el Oasis Tropical.Válido por una noche en la zona de Camping y acceso de dos días al parque acuático sólo para la fecha seleccionada (si tu compra es para un día de no operación del parque, sólo incluirá un día de acceso al parque acuático. Boleto personal e intransferible. Niños y niñas menores de 1.20 m de estatura no pagan entrada al parque ni zona de camping. El check-in será de 3 pm. a 6 pm. y el check-out será máximo a las 6 pm. Si tu check-in será un día que el parque se encuentra abierto, este podrá ser de 8 am. a 6 pm. Consulta detalles y reglamento de la zona de Camping previa compra. Recuerda que debes llevar tu propia tienda de campaña.', 215.52, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 1444, 1)
   , (10120603, 10, 2, 'Zona de camping', 'Todo lo necesario para que pases una noche cómoda y divertida, y despiertes listo para un día lleno de emociones y adrenalina en el Oasis Tropical.Válido por una noche en la zona de Camping y acceso de dos días al parque acuático sólo para la fecha seleccionada. Boleto personal e intransferible. Niños y niñas menores de 90 cm de estatura no pagan entrada al parque ni zona de camping. El check-in será de 8 am. a 6 pm. y el check-out será máximo a las 6 pm. Consulta detalles y reglamento de la zona de Camping previa compra. Recuerda que debes llevar tu propia tienda de campaña.', 387.94, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 153, 1)
   , (10105267, 1, 2, '2023 Platinum Pass', '¡Obtén visitas ilimitadas a todos los parques de Six Flags, además de Hurricane Harbor Oaxtepec! También, recibirás beneficios exclusivos como estacionamiento sin costo, descuentos en comida y souvenirs seleccionados y más.El pase vence el 31 de diciembre de 2023. No incluye el consumo de alimentos, bebidas, mercancía, juegos de destreza, atracciones con costo adicional, conciertos o eventos especiales. ', 1047.41, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1461, 1)
   , (10092967, 2, 2, 'Admisión General - Días Hábiles', ' Válido para una admisión a [Hurricane Harbor Ox] en [Oaxtepec, Morelos] en los días y horarios de operación programados. Tu boleto es personal e intransferible. Niños menores de 1.20 mts entran gratis. Válido por un día de visita con acceso a todas las atracciones acuáticas.  Por favor revisa los días y horarios de operación del parque para que puedas programar tu visita en sixflags.com.mx/es/hurricaneharborox No hay cambios ni devoluciones.  CUPO LIMITADO. EL TITULAR DEBERÁ PRESENTAR IDENTIFICACIÓN OFICIAL Y TARJETA CON LA QUE FUE REALIZADA LA COMPRA.', 329.11, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1156, 1)
