   , (10115154, 5, 2, 'Boleto de un Día por visita Grupal', 'Precio mostrado en pantalla + impuestos.Válido para una Admisión General a Hurricane Harbor Oaxtepec sólo para el día seleccionado en el calendario operativo. (no podrá ser utilizado en ninguna otra fecha ni modificado). Menores de 1.20 mts entran gratis. Cualquier aclaración sobre esta reservación previo a la fecha de la visita.Boleto personal e intransferible. No incluye el consumo de alimentos, bebidas, mercancía o atracciones con costo adicional. Niñas y niños menores de 1.20 mts de estatura entran GRATIS. El acceso a los toboganes y atracciones está sujeto a disponibilidad, condiciones climáticas, mantenimiento y a las restricciones de seguridad. No se cuenta con reingresos al parque. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago.', 295.36, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 197, 20)
   , (10107711, 7, 2, 'Cabana Platino $1500', '¿Buscas una zona exclusiva para relajarte Mejora tu visita a Hurricane Harbor Oaxtepec en una cabana privada, con espacio hasta para 5 personas. Ubicada cerca de " ". Incluye 2 camastros, 3 sillas, una mesa, un locker y 5 botellas de agua. Además, puedes ingresar tus propios alimentos en una hielera (tamaño máximo 63.5x35.5x35.5 centímetros).La renta de cabanas no es reembolsable, sin excepciones. Debido al cupo limitado, si no te presentas en el día seleccionado, antes de las 14:00 hrs., tu reservación será cancelada, sin ningún tipo de reembolso. Únicamente se puede reservar una cabana en cada compra. No se permite ningún tipo de vidrio, bebida alcohólica ni botella abierta en la hielera.', 1293.10, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 95, 1)
