   , (80004535, 6, 2, 'Socio Gold Plus (4+) c/3 meses gratis', ' Inscríbete para una Membresía GOLD PLUS hoy y ahorra hasta un 50% del precio regular, MÁS tres meses adicionales al final de tu membresía. Nuestra nueva Membresía Gold Plus ofrece más valor, más descuentos y más beneficios exclusivos de los que ofrecemos en nuestros mejores Pases Anuales y a un precio mucho más bajo.  Como socio Gold Plus, recibirás todos los beneficios de un Pase Anual Gold, más los siguientes beneficios:      Acceso ilimitado a los parques Six Flags   Estacionamiento en todos los parques Six Flags (ahorre $200 por visita)   Más docenas de beneficios adicionales. Consulta el sitio web para obtener más detalles.    Regístrate para obtener una Membresía a través de esta promoción y agregaremos tres meses adicionales de Membresía gratis a tu cuenta inmediatamente después de tu último mes pagado. Para recibir tus meses adicionales gratuitos, debes estar al día con los pagos de tu membresía y solicitar tu cancelación a través de nuestro proceso de cancelación regular. Los complementos como Pase de Alimentos y Pase Flash Pass no están incluidos en esta oferta especial y no se extenderán automáticamente al período gratuito. En lugar de tres meses gratis, los miembros que permanezcan en el programa 48 meses recibirán un crédito en el parque equivalente a tres meses de sus cuotas de membresía mensuales regulares (no incluye complementos como Comidas para socios o Flash Pass para socios).   Las membresías deben recogerse en Six Flags México antes de que visites otros parques. Los niños menores de dos años entran gratis. Las membresías pueden cancelarse en cualquier momento después de los primeros 12 meses. Lea atentamente el Contrato de Membresía.  ', 49.79, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 916, 4)
