   , (80004547, 6, 2, 'Socio Diamante Elite (4+) c/3 meses gratis', '"OFERTA POR TIEMPO LIMITADO: Obten una Membresía Diamond Elite y ahorra hasta 50% sobre el precio regular, MÁS tres meses adicionales al final de tu membresía. Diamond Elite es nuestra mejor membresía e incluye beneficios Diamond, estacionamiento preferente, ingreso por fila rápida DOS veces por visita y hasta un 50% de descuento en casi todo del parque. Como socio Diamond Elite, recibirás: Todos los beneficios de Gold Plus, Platinum y Diamond  50% de descuento en casi todo del parque  Estacionamiento preferente en cada visita  Ingreso por fila rápida en juegos mecánicos DOS veces en cada visita  Docenas de beneficios adicionales. Consulta el sitio web para detalles.  Regístrate para obtener una Membresía a través de esta promoción y agregaremos tres meses adicionales de membresía gratis a tu cuenta inmediatamente después de tu último mes pagado. Para recibir tus meses adicionales gratuitos, debes estar al día con los pagos de tu membresía y solicitar tu cancelación a través de nuestro proceso de cancelación regular. Los complementos como Membresías de Alimentos y Pase Flash Pass no están incluidos en esta oferta especial y no se extenderán automáticamente al período gratuito. En lugar de tres meses gratis, los miembros que permanezcan en el programa 48 meses recibirán un crédito en el parque equivalente a tres meses de sus cuotas de membresía mensuales regulares (no incluye complementos como Comidas o Pase Flash Pass para socios).  Las Membresías deben recogerse en Six Flags México antes de que visites otros parques. Los niños menores de dos años entran gratis. Las membresías pueden cancelarse en cualquier momento después de los primeros 12 meses. Lea el contrato de membresía cuidadosamente. ', 142.62, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 914, 4)
   , (10118595, 7, 2, 'Tent - Hurricane Bay $600', '¿Buscas una zona exclusiva para relajarte Mejora tu visita a Hurricane Harbor Oaxtepec rentando un Tent con espacio hasta para 4 personas. ¡Ubicado frente a la alberca de olas! Incluye 2 camastros, 2 sillas, una mesa y una hielera con 4 aguas embotelladas.La renta de Tents no es reembolsable, sin excepciones. Debido al cupo limitado, si no te presentas en el día seleccionado, antes de las 14:00 hrs., tu reservación será cancelada, sin ningún tipo de reembolso. Únicamente se puede reservar hasta dos Tents por transacción. La reventa y/o reproducción de este boleto está estrictamente prohibida. ', 517.24, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1211, 1)
   , (10120570, 7, 2, 'Cabana Platino $900', '¿Buscas una zona exclusiva para relajarte Mejora tu visita a Hurricane Harbor Oaxtepec en una cabana privada, con espacio hasta para 5 personas. Ubicada cerca de " ". Incluye 2 camastros, 3 sillas, una mesa, un locker y 5 botellas de agua. Además, puedes ingresar tus propios alimentos en una hielera (tamaño máximo 63.5x35.5x35.5 centímetros).La renta de cabanas no es reembolsable, sin excepciones. Debido al cupo limitado, si no te presentas en el día seleccionado, antes de las 14:00 hrs., tu reservación será cancelada, sin ningún tipo de reembolso. Únicamente se puede reservar una cabana en cada compra. No se permite ningún tipo de vidrio, bebida alcohólica ni botella abierta en la hielera.', 775.86, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 189, 1)
   , (10100168, 3, 2, 'Plan de 2 Alimentos 2023 - 12 Flex', 'Con este Plan Anual de Alimentos, manténte alimentado todo el año. Disfruta comida y cena en cada visita durante todo el 2023Este Plan de Alimentos expira cuando vence el Plan Anual asociado.¡Disfruta 2 comidas en cada visita durante todo el año 2023! Sólo con 3 horas de intervalo entre cada comida. Las bebidas no están incluidas. Sujeto a disponibilidad de menú y restaurantes. Válido únicamente en Six Flags México y Hurricane Harbor Oaxtepec.  Los Planes de Alimento están disponibles sólo para socios de pases y se agregarán a tu credencial (se compran por separado). Son personales e instranferibles. IVA incluido. Las comidas disponibles se verán identificadas en el menú de cada restaurante.', 2999.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1391, 1)
   , (10118207, 1, 2, 'Platinum Pass 2024 - 6 Flx', 'Disfrutavisitas ilimitadas, estacionamiento sin costo, beneficios exclusivos, descuentos y más conforme a calendario operativo en todos los parques Six Flags por lo que resta de 2023 y todo el año 2024, incluyendo Festival del Terror y Christmas In the Park.Válido al 31 de diciembre de 2024. El Pase debe ser activado en Hurricane Harbor Oaxtepec antes de ser utilizado en otros parques y antes de poder utilizar los beneficios incluidos. Consulta la lista completa de beneficios previa compra  https://www.sixflags.com.mx/hurricaneharborox/store/tickets/"AQUÍ.  Niñas y niños menores de 1.20 m de estatura entran GRATIS a Hurricane Harbor Oaxtepec. Alimentos, souvenirs, juegos de destreza, atracciones con costo adicional y eventos especiales no están incluidos en el Pase. El Acceso a juegos mecánicos, toboganes y atracciones está sujeto a disponibilidad, condiciones climáticas, mantenimiento y a las restricciones de seguridad de cada juego. Compra no reembolsable o modificable una vez confirmada. Para validar la compra, puede solicitarse la presencia del titular con su identificación y tarjeta con la que realizó el pago. ', 1206.90, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1321, 1)
   , (10118596, 7, 2, 'Tent - Splash Island $550', 'Cabana para 4 personas. Paga un costo adicional hasta por 2 personas extra. Tendrás acceso a una de nuestras Cabanas Privadas para que disfrutes tu día en Hurricane Harbor Oaxtepec.Este boleto es válido sólo en Hurricane Harbor Oaxtepec en el día de la visita.  En caso de mal uso, reventa o falsificación , el presente boleto será retirado y cancelado por Hurricane Harbor Oaxtepec sin ningún tipo de reembolso. Este boleto no es reembolsable y su reventa se encuentra estrictamente prohibida. Este boleto no es válido si presenta tachadura, enmendaduras o cualquier tipo de alteración. PROHIBIDA SU VENTA EN LUGARES NO AUTORIZADOS', 474.14, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 0, 1007, 1)
