   , (90001597, 9, 1, 'Paquete de Boleto de un día + Plan de Alimentos de un Día', 'OFERTA POR TIEMPO LIMITADO: Disponible solo en fechas operativas seleccionadas hasta el 7 de enero de 2024.Este boleto es válido para un día de admisión a Six Flags México y una oferta de comidas ilimitadas. El impuesto sobre las ventas se agregará a la porción de comida de este boleto. Válido para la fecha que elegiste durante la temporada 2023 para Six Flags Magic México. Consulta sixflags.com para conocer el cronograma de operación, las políticas del parque y los protocolos de seguridad. No hay reembolsos en compras de boletos de un solo día. Tenga en cuenta que los niños menores de 2 años entran gratis. Disfrute de una comida de su elección en los restaurantes participantes. Elija entre una variedad de opciones que incluyen tiras de pollo, hamburguesas, pizza y mucho más. ADEMÁS, ¡disfruta de refrescantes bebidas Coca-Cola durante todo el día con una botella Drink All Day 2023!Válido para la fecha que elegiste durante la temporada 2023 para Six Flags México. Consulta sixflags.com para conocer el cronograma de operación, las políticas del parque y los protocolos de seguridad. No hay reembolsos en compras de boletos de un solo día. Tenga en cuenta que los niños menores de 2 años entran gratis. Disfrute de una comida de su elección en los restaurantes participantes. Elija entre una variedad de opciones que incluyen tiras de pollo, hamburguesas, pizza y mucho más. ADEMÁS, ¡disfruta de refrescantes bebidas Coca-Cola durante todo el día con una botella Drink All Day 2023!', 1517.00, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 252, 1)
   , (10114506, 9, 1, 'Paquete de Admisión General + THE FLASH Pass Platino', 'Entrada de un día a Six Flags México y un pase THE FLASH de nivel platino para un solo pasajero, válido para la fecha que elijas durante la temporada 2023. Imprima y presente (o muéstrelo a través de su dispositivo móvil) en la puerta de entrada al parque. Siga las instrucciones impresas en su boleto para canjear THE FLASH Pass.Consulte sixflags.com para conocer el cronograma operativo, las políticas del parque y los protocolos de seguridad. No hay reembolsos en la compra de boletos. Tenga en cuenta que los niños menores de 2 años entran gratis y no necesitan entrada.', 2641.96, '2020-01-01 00:00:00', '2023-12-31 00:00:00', 1, 881, 1)
